import { Component } from '@angular/core';

@Component({
  selector: 'app-search-flights',
  templateUrl: './search-flights.component.html',
  styleUrls: ['./search-flights.component.css']
})
export class SearchFlightsComponent {

  searchResult: FlightRm[] = [
    {
      airline: "S7",
      arrival: { time: Date.now().toString(), place: "Novosibirsk" },
      departure: { time: Date.now().toString(), place: "Omsk" },
      price: "8000",
      remainingNumberOfSeats:40,
    },
    {
      airline: "UralAirlines",
      arrival: { time: Date.now().toString(), place: "Moscow" },
      departure: { time: Date.now().toString(), place: "Omsk" },
      price: "500",
      remainingNumberOfSeats: 20,
    }
  ]
}

export interface FlightRm {
  airline: string;
  arrival: TimePlaceRm;
  departure: TimePlaceRm;
  price: string;
  remainingNumberOfSeats: number;
}

export interface TimePlaceRm {
  place: string;
  time: string;
}
